/**
 * Windows.Win32.UI.TabletPC.SYSTEM_EVENT_DATA (size: 32)
 */
export interface SYSTEM_EVENT_DATA {
  /** u8 */
  bModifier: number;
  /** char */
  wKey: Uint8Array | Deno.PointerValue;
  /** i32 */
  xPos: number;
  /** i32 */
  yPos: number;
  /** u8 */
  bCursorMode: number;
  /** u32 */
  dwButtonState: number;
}

export const sizeofSYSTEM_EVENT_DATA = 32;

export function allocSYSTEM_EVENT_DATA(data?: Partial<SYSTEM_EVENT_DATA>): Uint8Array {
  const buf = new Uint8Array(sizeofSYSTEM_EVENT_DATA);
  const view = new DataView(buf.buffer);
  // 0x00: u8
  if (data?.bModifier !== undefined) view.setUint8(0, Number(data.bModifier));
  // 0x01: pad7
  // 0x08: pointer
  if (data?.wKey !== undefined) view.setBigUint64(8, data.wKey === null ? 0n : BigInt(Deno.UnsafePointer.value(util.toPointer(data.wKey))), true);
  // 0x10: i32
  if (data?.xPos !== undefined) view.setInt32(16, Number(data.xPos), true);
  // 0x14: i32
  if (data?.yPos !== undefined) view.setInt32(20, Number(data.yPos), true);
  // 0x18: u8
  if (data?.bCursorMode !== undefined) view.setUint8(24, Number(data.bCursorMode));
  // 0x19: u32
  if (data?.dwButtonState !== undefined) view.setUint32(25, Number(data.dwButtonState), true);
  // 0x1d: pad3
  return buf;
}

export class SYSTEM_EVENT_DATAView {
  private readonly view: DataView;
  constructor(private readonly buf: Uint8Array) {
    this.view = new DataView(buf.buffer);
  }

  get buffer(): Uint8Array {
    return this.buf;
  }

  // 0x00: u8
  get bModifier(): number {
    return this.view.getUint8(0);
  }

  // 0x01: pad7

  // 0x08: pointer
  get wKey(): Uint8Array | Deno.PointerValue {
    const ptr = this.view.getBigUint64(8, true);
    return Deno.UnsafePointer.create(ptr);
  }

  // 0x10: i32
  get xPos(): number {
    return this.view.getInt32(16, true);
  }

  // 0x14: i32
  get yPos(): number {
    return this.view.getInt32(20, true);
  }

  // 0x18: u8
  get bCursorMode(): number {
    return this.view.getUint8(24);
  }

  // 0x19: u32
  get dwButtonState(): number {
    return this.view.getUint32(25, true);
  }

  // 0x1d: pad3

  // 0x00: u8
  set bModifier(value: number) {
    this.view.setUint8(0, value);
  }

  // 0x01: pad7

  // 0x08: pointer
  set wKey(value: Uint8Array | Deno.PointerValue) {
    this.view.setBigUint64(8, BigInt(Deno.UnsafePointer.value(util.toPointer(value))), true);
  }

  // 0x10: i32
  set xPos(value: number) {
    this.view.setInt32(16, value, true);
  }

  // 0x14: i32
  set yPos(value: number) {
    this.view.setInt32(20, value, true);
  }

  // 0x18: u8
  set bCursorMode(value: number) {
    this.view.setUint8(24, value);
  }

  // 0x19: u32
  set dwButtonState(value: number) {
    this.view.setUint32(25, value, true);
  }

  // 0x1d: pad3
}

